import React, { useState } from "react";

import "./ExpensesFilter.css";

const ExpensesFilter = () => {
  const [selectedYear, setSelectedYear] = useState("");

  const SelectedYearHandler = (event) => {
    const yearData = selectedYear;
    setSelectedYear(event.target.value);
    console.log(yearData);
  };

  return (
    <div className="expenses-filter">
      <div className="expenses-filter__control">
        <label>Filter by year</label>
        <select>
          <option value="2022" onClick={SelectedYearHandler}>
            2022
          </option>
          <option value="2021" onClick={SelectedYearHandler}>
            2021
          </option>
          <option value="2020" onClick={SelectedYearHandler}>
            2020
          </option>
          <option value="2019" onClick={SelectedYearHandler}>
            2019
          </option>
        </select>
      </div>
    </div>
  );
};

export default ExpensesFilter;
